package net.goldfoxyt.atdl.io;

import net.goldfoxyt.atdl.model.Task;

import java.util.ArrayList;

public class TaskManager {
    private static final String ANSI_GREEN = "\u001B[32m";
    private static final String ANSI_RESET = "\u001B[0m";
    private ArrayList<Task> tasks = new ArrayList<>();

    public void addTask(String description) {
        tasks.add(new Task(description));
        System.out.println("Task added successfully");
    }

    public void deleteTask(String description) {
        Task taskToRemove = null;
        for (Task task : tasks) {
            if (task.getDescription().equals(description)) {
                taskToRemove = task;
                break;
            }
        }
        if (taskToRemove != null) {
            tasks.remove(taskToRemove);
            System.out.println("Task deleted successfully");
        } else {
            System.out.println("Task not found");
        }
    }

    public void listTasks() {
        if (!tasks.isEmpty()) {
            System.out.println(ANSI_GREEN + tasks + ANSI_RESET);
        } else {
            System.out.println("No tasks found");
        }
    }

    public ArrayList<Task> getTasks() {
        return tasks;
    }
}

package net.goldfoxyt.atdl.ui;

import javafx.application.Application;
import javafx.scene.Scene;
import javafx.scene.control.*;
import javafx.scene.layout.VBox;
import javafx.stage.Stage;
import net.goldfoxyt.atdl.io.TaskManager;
import net.goldfoxyt.atdl.manager.FileManager;

import java.util.Scanner;

public class Menu extends Application {
    private TaskManager taskManager;
    private FileManager fileManager;

    public Menu(TaskManager taskManager, FileManager fileManager) {
        this.taskManager = taskManager;
        this.fileManager = fileManager;
    }

    @Override
    public void start(Stage primaryStage) {
        primaryStage.setTitle("To-Do List");

        VBox vbox = new VBox();
        vbox.setSpacing(10);

        Label welcomeLabel = new Label("Welcome to my To-Do List!");

        Button addButton = new Button("Add Task");
        addButton.setOnAction(e -> {
            TextInputDialog dialog = new TextInputDialog();
            dialog.setTitle("Add Task");
            dialog.setHeaderText("Please type the task");
            dialog.showAndWait().ifPresent(task -> taskManager.addTask(task));
        });

        Button deleteButton = new Button("Delete Task");
        deleteButton.setOnAction(e -> {
            TextInputDialog dialog = new TextInputDialog();
            dialog.setTitle("Delete Task");
            dialog.setHeaderText("Please type the task you want to delete");
            dialog.showAndWait().ifPresent(task -> taskManager.deleteTask(task));
        });

        Button listButton = new Button("List Tasks");
        listButton.setOnAction(e -> taskManager.listTasks());

        Button exportButton = new Button("Export Tasks to Txt");
        exportButton.setOnAction(e -> fileManager.exportListToTxt(taskManager.getTasks()));

        Button importButton = new Button("Import Tasks from Txt");
        importButton.setOnAction(e -> fileManager.importListFromTxt(taskManager.getTasks()));

        Button exitButton = new Button("Exit");
        exitButton.setOnAction(e -> {
            System.out.println("Thank you for using the To-Do List, Bye!");
            primaryStage.close();
        });

        vbox.getChildren().addAll(welcomeLabel, addButton, deleteButton, listButton, exportButton, importButton, exitButton);

        Scene scene = new Scene(vbox, 300, 250);
        primaryStage.setScene(scene);
        primaryStage.show();
    }

    public static void main(String[] args) {
        launch(args);
    }
}

