package net.goldfoxyt.atdl.manager;

import net.goldfoxyt.atdl.model.Task;

import javafx.stage.FileChooser;
import javafx.stage.Stage;
import java.io.*;
import java.util.ArrayList;

public class FileManager {
    private Stage stage;

    public FileManager(Stage stage) {
        this.stage = stage;
    }

    public void exportListToTxt(ArrayList<Task> tasks) {
        FileChooser fileChooser = new FileChooser();
        fileChooser.getExtensionFilters().add(new FileChooser.ExtensionFilter("Text files", "*.txt"));

        File fileToSave = fileChooser.showSaveDialog(stage);
        if (fileToSave != null) {
            if (!fileToSave.getName().toLowerCase().endsWith(".txt")) {
                fileToSave = new File(fileToSave.getParentFile(), fileToSave.getName() + ".txt");
            }
            writeTasksToFile(tasks, fileToSave);
        }
    }

    private void writeTasksToFile(ArrayList<Task> tasks, File file) {
        try (FileWriter writer = new FileWriter(file)) {
            for (Task task : tasks) {
                writer.write(task.toString() + "\n");
            }
            System.out.println("List exported successfully to " + file.getAbsolutePath());
        } catch (IOException e) {
            System.out.println("Error exporting list to txt file: " + e.getMessage());
        }
    }

    public void importListFromTxt(ArrayList<Task> tasks) {
        FileChooser fileChooser = new FileChooser();
        fileChooser.getExtensionFilters().add(new FileChooser.ExtensionFilter("Text files", "*.txt"));

        File fileToLoad = fileChooser.showOpenDialog(stage);
        if (fileToLoad != null) {
            try (BufferedReader reader = new BufferedReader(new FileReader(fileToLoad))) {
                String line;
                while ((line = reader.readLine()) != null) {
                    tasks.add(new Task(line));
                }
                System.out.println("List imported successfully from " + fileToLoad.getAbsolutePath());
            } catch (IOException e) {
                System.out.println("Error importing list from txt file: " + e.getMessage());
            }
        }
    }
}

